(9, 1, '2018-11-01 10:25:16', '2018-11-01 10:25:16', '.header-top .header-social ul li a {\n    font-size: 14px;\n    color: #000;\n}\n.header-top.clearfix {\n    padding: 30px 0;\n}\n.main-menu {\n    background: #e36135;\n}\n.main-menu #top-menu li a {\n    padding: 20px;\n    color: #fff;\n}\n.header-top .logo_container {\n    width: 40%;\n    float: left;\n}\n.header-top-right {\n    width: 30%;\n    float: right;\n}\n.header-top-right ul li {\n    display: inline-block;\n}\n.header-top .header-social .et-social-icons {\n    float: unset;\n    text-align: left;\n}\n.header-top-left{\n	width:30%;\n	float:left;\n}\n.header-top-left .header-social {\n    padding: 39px 0;\n}\n.header-top-right {\n    width: 30%;\n    float: right;\n    padding: 36px 0;\n}\n.container.clearfix.et_menu_container {\n    width: 100%;\n    max-width: 100%;\n	padding:0px;\n}\ndiv#top-header {\n    display: none;\n}\n.logo_container #logo {\n    max-height: 100% !important;\n}\n.container {\n    width: 90%;\n    max-width: 90%;\n}\nul.social-icons.search-form li {\n    display: inline-block;\n    margin-right: 8px;\n}\nli.search_form input {\n    background: transparent;\n    border: 2px solid #59595c;\n    border-radius: 20px;\n    padding: 6px;\n}\n.header-top-right li a {\n    background: #e15526;\n    font-size: 14px;\n    color: #fff;\n    padding: 12px 24px;\n}\ndiv#nav_menu-3 .menu li a {\n    font-family: ''Rubik'', sans-serif;\n    font-weight: 700;\n    font-size: 15px;\n}\n\nul#menu-footer-menu2 li a {\n	font-family: ''Rubik'', sans-serif;\n    font-weight: 700;\n    font-size: 15px;\n}\nul#menu-footer-menu2 li,div#nav_menu-3 .menu li{\n	list-style-type:none;\n}\n#footer-widgets .footer-widget li:before{\n	border:none;\n}\n.footer_img img {\n    width: 100%;\n}\n.footer_img{\n	margin-bottom:50px;\n}\n.footer_detail p {\n    line-height: 28px;\n    font-size: 15px;\n		font-family: ''Rubik'', sans-serif;\n}\ndiv#nav_menu-3 {\n    margin-bottom: 0px;\n}\n.footer-widget div#nav_menu-3 {\n    float: unset !important;\n}\n.footer_social li{\n	display:inline-block;\n}\nspan#et-info-phone{\n	font-size: 14px;\n		font-family: ''Rubik'', sans-serif;\n}\nul.footer_img_list li {\n    display: inline-block;\n    vertical-align: middle;\n    margin-right: 57px;\n}\n.banner_img {\n    width: 49.8%;\n    float: right;\n}\n.banner_img.banner_img1 {\n    width: 49.8%;\n    float: left;\n}\n.banner_img img {\n    width: 100%;\n}\n.clearfix{\n	clear:both;\n}\n.home_banner{\n	position:relative;\n}\n.banner_btn{\n	position: absolute;\n    left: 0;\n    right: 0;\n    top: 50%;\n    background: #e15526;\n    color: #fff;\n    display: inline-block;\n    width: 313px;\n    margin: 0 auto;\n    letter-spacing: 6px;\n    padding: 15px 5px;\n    border: 2px solid #fff\n}\n\n/*.home #main-header {\n    position: static;\n}*/', 'Divi-child', '', 'publish', 'closed', 'closed', '', 'divi-child', '', '', '2018-11-02 06:27:25', '2018-11-02 06:27:25', '', 0, 'http://localhost/ItergiBuilt/2018/11/01/divi-child/', 0, 'custom_css', '', 0),
